import MotorCortex from "@kissmybutton/motorcortex";
import NoiseEffectDef from "./noiseEffect/main";
const NoiseEffectPlugin = MotorCortex.loadPlugin(NoiseEffectDef);

export default class TVNoise extends MotorCortex.HTMLClip {
  get html() {
    return `
        <div class="bg"> 
            <canvas id="tv" width="${this.attrs.width}" height="${this.attrs.height}"></canvas>
        </div>
        `;
  }

  get css() {
    return `
            .bg{
                background: black;
            }
        `;
  }

  get audioSources() {
    return [
      {
        src:
          "",
        base64: true,
        id: "static",
      },
    ];
  }

  buildTree() {
    const duration = this.attrs.duration;
    const noiseEffect = new NoiseEffectPlugin.NoiseEffect(
      {
        animatedAttrs: {
          canvasImage: "dynamic",
        },
      },
      {
        selector: "#tv",
        duration,
      }
    );

    this.addIncident(noiseEffect, 0);

    if (this.attrs.sound === true) {
      for (let i = 0; i < this.attrs.duration - 4000; i += 4000) {
        const sound = new MotorCortex.AudioPlayback({
          selector: "~#static",
          duration: 4000,
        });
        this.addIncident(sound, i * 4000);
      }
      const leftovers = this.attrs.duration % 4000;
      const leftoverSound = new MotorCortex.AudioPlayback({
        selector: "~#static",
        duration: leftovers,
      });
      this.addIncident(leftoverSound, this.attrs.duration - leftovers);
    }
  }
}
